import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
export default function Todo() {
    return (
        <div className="bg-primary">
             <h1 className="text-center">Todo  ka oage</h1>
             <ul class="nav justify-content-end  ">
             
                <li class="nav-item">
                <Link to="/" class="nav-link mx-3 my-2 btn btn-outline-light" type="button" aria-current="page" href="#">logout</Link>
                </li>
            </ul>

        </div>
    )
}
